import React from 'react';
import './App.css';

function App() {
  return (
    <div class="outer">
      <div class="center"/>
      <div class="left-bottom"></div>
      <div class="row">
          <div class="box float-box"/>
          <div class="box float-box"/>
          <div class="box float-box"/>
      </div>
      <div class="new-row box"/>
      <div class="absolute-center box"/>
    </div>
  );
}

export default App;
